const defaultState = [
  { id: 1, name: "Geladeira", price: 200, description: '', image: ''},
  { id: 2, name: "Geladeira", price: 200, description: '', image: ''},
  { id: 3, name: "Geladeira", price: 200, description: '', image: ''},
  { id: 4, name: "Geladeira", price: 200, description: '', image: ''},
  { id: 5, name: "Geladeira", price: 200, description: '', image: ''},
  { id: 6, name: "Geladeira", price: 200, description: '', image: ''},
  { id: 7, name: "Geladeira", price: 200, description: '', image: ''},
  { id: 8, name: "Geladeira", price: 200, description: '', image: ''},
  { id: 9, name: "Geladeira", price: 200, description: '', image: ''},
  { id: 10, name: "Geladeira", price: 200, description: '', image: ''},
];

const productsReducer = (state = defaultState, action) => {
  console.log("Products", action);
  return state;
};

export default productsReducer;
